{
	"components": {
		"requestBodies": {},
		"responses": {},
		"schemas": {
			"Account": {
				"properties": {
					"AWSLoginURLs": {
						"properties": {
							"admin": {
								"type": "string"
							},
							"developer": {
								"type": "string"
							},
							"readonly": {
								"type": "string"
							}
						},
						"type": "object"
					},
					"AccountType": {
						"type": "string"
					},
					"AllocatedTS": {
						"description": "Allocated timestamp.",
						"example": "2018-10-11T01:05:45.000Z",
						"format": "date-time",
						"readOnly": true,
						"type": "string"
					},
					"AssuranceState": {
						"description": "Hardening state of the Account.",
						"enum": [
							"NONE",
							"UPDATING",
							"ACTIVE",
							"ERROR"
						],
						"example": "ACTIVE",
						"readOnly": true,
						"type": "string"
					},
					"AssuranceStateReason": {
						"description": "Descriptive reason for the current AssuranceState.",
						"example": "AWS GuardDuty Hardening has failed",
						"readOnly": true,
						"type": "string"
					},
					"AwsAccountId": {
						"description": "AWS Account Id.",
						"example": "012345678901",
						"maxLength": 12,
						"minLength": 12,
						"readOnly": true,
						"type": "string"
					},
					"AwsAccountStatusId": {
						"type": "string"
					},
					"AwsLoginURL": {
						"type": "string"
					},
					"CreatedBy": {
						"description": "UUID of the account creator.",
						"example": "ec5eaa8f-da06-4935-b5ce-05bd957c8bdc",
						"pattern": "[0-9a-fA-F]{8}-[0-9a-fA-F]{4}-[0-9a-fA-F]{4}-[0-9a-fA-F]{4}-[0-9a-fA-F]{12}",
						"readOnly": true,
						"type": "string"
					},
					"CreatedTS": {
						"description": "Created timestamp.",
						"example": "2018-10-11T01:05:45.000Z",
						"format": "date-time",
						"readOnly": true,
						"type": "string"
					},
					"Email": {
						"description": "Email address of account owner.",
						"example": "stax.user@example.com",
						"format": "email",
						"maxLength": 128,
						"minLength": 6,
						"readOnly": true,
						"type": "string"
					},
					"Id": {
						"$ref": "#\/components\/schemas\/ro-uuidv4"
					},
					"LatestCost": {
						"example": 72.52,
						"readOnly": true,
						"type": "number"
					},
					"ModifiedTS": {
						"description": "Modified timestamp.",
						"example": "2019-03-11T01:11:40.000Z",
						"format": "date-time",
						"readOnly": true,
						"type": "string"
					},
					"Name": {
						"description": "Name of the Account.",
						"example": "bakery",
						"maxLength": 64,
						"minLength": 2,
						"type": "string"
					},
					"OrganisationId": {
						"$ref": "#\/components\/schemas\/uuidv4"
					},
					"OrgsOuId": {
						"type": "string"
					},
					"Origin": {
						"description": "Origin of the Account.",
						"enum": [
							"STAX",
							"External"
						],
						"example": "STAX",
						"readOnly": true,
						"type": "string"
					},
					"Status": {
						"description": "Status of the Account.",
						"enum": [
							"ACTIVE",
							"AWSERROR",
							"CLOSED",
							"DISCOVERED",
							"ERROR",
							"INITIALIZING",
							"MAINTENANCE",
							"NEW",
							"NOAWS",
							"SUSPENDED"
						],
						"example": "ACTIVE",
						"readOnly": true,
						"type": "string"
					},
					"StaxCreated": {
						"type": "boolean"
					},
					"Tags": {
						"$ref": "#\/components\/schemas\/Tags"
					},
					"UserTaskId": {
						"$ref": "#\/components\/schemas\/ro-uuidv4"
					}
				},
				"required": [
					"OrganisationId",
					"Name"
				],
				"type": "object"
			},
			"AccountTask": {
				"allOf": [
					{
						"$ref": "#\/components\/schemas\/BaseTask"
					}
				],
				"properties": {
					"Accounts": {
						"items": {
							"$ref": "#\/components\/schemas\/ro-uuidv4"
						},
						"type": "array"
					}
				},
				"type": "object"
			},
			"AccountType": {
				"properties": {
					"Accounts": {
						"example": [],
						"type": "array"
					},
					"CreatedBy": {
						"description": "UUID of the account creator.",
						"example": "ec5eaa8f-da06-4935-b5ce-05bd957c8bdc",
						"nullable": true,
						"pattern": "[0-9a-fA-F]{8}-[0-9a-fA-F]{4}-[0-9a-fA-F]{4}-[0-9a-fA-F]{4}-[0-9a-fA-F]{12}",
						"readOnly": true,
						"type": "string"
					},
					"CreatedTS": {
						"description": "Created timestamp.",
						"example": "2018-10-11T01:05:45.000Z",
						"format": "date-time",
						"readOnly": true,
						"type": "string"
					},
					"Id": {
						"$ref": "#\/components\/schemas\/ro-uuidv4"
					},
					"ModifiedTS": {
						"description": "Modified timestamp.",
						"example": "2018-10-11T01:05:45.000Z",
						"format": "date-time",
						"readOnly": true,
						"type": "string"
					},
					"Name": {
						"description": "Name of Account Type.",
						"example": "Development",
						"maxLength": 64,
						"minLength": 3,
						"type": "string"
					},
					"OrganisationId": {
						"$ref": "#\/components\/schemas\/ro-uuidv4"
					},
					"Policies": {
						"example": [],
						"type": "array"
					},
					"Roles": {
						"example": [],
						"type": "array"
					},
					"Status": {
						"enum": [
							"ACTIVE",
							"DELETED"
						],
						"example": "ACTIVE"
					},
					"StaxCreated": {
						"type": "boolean"
					}
				},
				"required": [
					"OrganisationId",
					"Name"
				],
				"type": "object"
			},
			"AccountTypeAccessMap": {
				"additionalProperties": false,
				"anyOf": [
					{
						"required": [
							"AccountTypeId",
							"GroupId",
							"RoleName"
						]
					},
					{
						"required": [
							"AccountTypeName",
							"GroupId",
							"RoleName"
						]
					},
					{
						"required": [
							"AccountTypeId",
							"GroupName",
							"RoleName"
						]
					},
					{
						"required": [
							"AccountTypeName",
							"GroupName",
							"RoleName"
						]
					}
				],
				"properties": {
					"AccountTypeId": {
						"$ref": "#\/components\/schemas\/uuidv4"
					},
					"AccountTypeName": {
						"type": "string"
					},
					"GroupId": {
						"$ref": "#\/components\/schemas\/uuidv4"
					},
					"GroupName": {
						"type": "string"
					},
					"RoleName": {
						"$ref": "#\/components\/schemas\/AwsAccessRole"
					}
				},
				"type": "object"
			},
			"AccountTypeMemberMap": {
				"additionalProperties": false,
				"anyOf": [
					{
						"required": [
							"AccountTypeId",
							"AccountId"
						]
					},
					{
						"required": [
							"AccountTypeName",
							"AccountId"
						]
					}
				],
				"properties": {
					"AccountId": {
						"$ref": "#\/components\/schemas\/uuidv4"
					},
					"AccountTypeId": {
						"$ref": "#\/components\/schemas\/uuidv4"
					},
					"AccountTypeName": {
						"type": "string"
					}
				},
				"type": "object"
			},
			"AccountTypePolicyMap": {
				"additionalProperties": false,
				"anyOf": [
					{
						"required": [
							"AccountTypeId",
							"PolicyId"
						]
					},
					{
						"required": [
							"AccountTypeName",
							"PolicyId"
						]
					}
				],
				"properties": {
					"AccountTypeId": {
						"$ref": "#\/components\/schemas\/uuidv4"
					},
					"AccountTypeName": {
						"type": "string"
					},
					"PolicyId": {
						"$ref": "#\/components\/schemas\/uuidv4"
					}
				},
				"type": "object"
			},
			"Alias": {
				"properties": {
					"Alias": {
						"properties": {
							"Status": {
								"enum": [
									"The company alias provided is available",
									"The company alias provided is already in use by another customer and cannot be used"
								],
								"example": "The company alias provided is available",
								"type": "string"
							}
						},
						"type": "object"
					}
				},
				"type": "object"
			},
			"AliasInUse": {
				"properties": {
					"Alias": {
						"properties": {
							"Status": {
								"enum": [
									"The company alias provided is available",
									"The company alias provided is already in use by another customer and cannot be used"
								],
								"example": "The company alias provided is already in use by another customer and cannot be used",
								"type": "string"
							}
						},
						"type": "object"
					}
				},
				"type": "object"
			},
			"ApiRole": {
				"description": "Stax role assigned to an API Token.",
				"enum": [
					"api_admin",
					"api_user",
					"api_readonly"
				],
				"type": "string"
			},
			"AwsAccessRole": {
				"description": "AWS access roles enabled for an account type.",
				"enum": [
					"admin",
					"developer",
					"readonly"
				],
				"type": "string"
			},
			"AwsRegion": {
				"description": "AWS Region",
				"enum": [
					"ap-northeast-1",
					"ap-northeast-2",
					"ap-south-1",
					"ap-southeast-1",
					"ap-southeast-2",
					"ca-central-1",
					"eu-central-1",
					"eu-north-1",
					"eu-west-1",
					"eu-west-2",
					"eu-west-3",
					"sa-east-1",
					"us-east-1",
					"us-east-2",
					"us-west-1",
					"us-west-2"
				],
				"type": "string"
			},
			"BaseEvent": {
				"properties": {
					"DetailType": {
						"type": "string"
					}
				},
				"type": "object"
			},
			"BaseEventDetail": {
				"properties": {
					"Message": {
						"type": "string"
					},
					"Operation": {
						"$ref": "#\/components\/schemas\/Operation"
					},
					"OperationStatus": {
						"$ref": "#\/components\/schemas\/OperationStatus"
					},
					"Severity": {
						"type": "string"
					}
				},
				"type": "object"
			},
			"BaseTask": {
				"properties": {
					"Id": {
						"$ref": "#\/components\/schemas\/ro-uuidv4"
					},
					"Status": {
						"type": "string"
					}
				},
				"type": "object"
			},
			"CidrExclusion": {
				"additionalProperties": false,
				"properties": {
					"Cidr": {
						"description": "CIDR Range in quad dot notation.",
						"example": "10.128.0.0\/19",
						"type": "string"
					},
					"CreatedBy": {
						"anyOf": [
							{
								"nullable": true
							},
							{
								"$ref": "#\/components\/schemas\/ro-uuidv4"
							}
						]
					},
					"CreatedTS": {
						"description": "Created timestamp.",
						"example": "2018-10-11T01:05:45.000Z",
						"format": "date-time",
						"readOnly": true,
						"type": "string"
					},
					"Description": {
						"anyOf": [
							{
								"nullable": true
							},
							{
								"description": "Longer description of what the CIDR Exclusion is used for.",
								"example": "datacenter exclusion",
								"maxLength": 512,
								"minLength": 0,
								"type": "string"
							}
						]
					},
					"Id": {
						"$ref": "#\/components\/schemas\/ro-uuidv4"
					},
					"ModifiedTS": {
						"description": "Modified timestamp.",
						"example": "2018-10-11T01:05:45.000Z",
						"format": "date-time",
						"readOnly": true,
						"type": "string"
					},
					"Name": {
						"description": "Name of the CIDR Exclusion.",
						"example": "non-prod",
						"maxLength": 64,
						"minLength": 2,
						"type": "string"
					},
					"NetworkingHubId": {
						"$ref": "#\/components\/schemas\/uuidv4"
					},
					"Status": {
						"description": "The status of the CIRD Exclusion.",
						"enum": [
							"ACTIVE",
							"DELETED",
							"CREATE_FAILED",
							"DELETE_FAILED"
						],
						"example": "ACTIVE",
						"readOnly": true,
						"type": "string"
					},
					"Tags": {
						"$ref": "#\/components\/schemas\/Tags"
					}
				},
				"required": [
					"Name",
					"Cidr"
				],
				"type": "object"
			},
			"CidrRange": {
				"properties": {
					"Cidr": {
						"description": "CIDR Range in quad dot notation. This range is a private network range with a size between \/8 to \/23",
						"example": "10.128.0.0\/23",
						"type": "string"
					},
					"CreatedBy": {
						"anyOf": [
							{
								"nullable": true
							},
							{
								"$ref": "#\/components\/schemas\/ro-uuidv4"
							}
						]
					},
					"CreatedTS": {
						"description": "Created timestamp.",
						"example": "2018-10-11T01:05:45.000Z",
						"format": "date-time",
						"readOnly": true,
						"type": "string"
					},
					"DefaultCidrRange": {
						"description": "Boolean value declaring if the range is the default CIDR Range",
						"example": false,
						"type": "boolean"
					},
					"Description": {
						"anyOf": [
							{
								"nullable": true
							},
							{
								"description": "Longer description of what the CIDR Range is used for.",
								"example": "datacenter ranges",
								"maxLength": 512,
								"minLength": 0,
								"type": "string"
							}
						]
					},
					"Id": {
						"$ref": "#\/components\/schemas\/ro-uuidv4"
					},
					"LastAllocationTS": {
						"description": "Created timestamp.",
						"example": "2018-10-11T01:05:45.000Z",
						"format": "date-time",
						"readOnly": true,
						"type": "string"
					},
					"ModifiedTS": {
						"description": "Modified timestamp.",
						"example": "2018-10-11T01:05:45.000Z",
						"format": "date-time",
						"readOnly": true,
						"type": "string"
					},
					"Name": {
						"description": "Name of the CIDR Range.",
						"example": "non-prod",
						"maxLength": 64,
						"minLength": 2,
						"type": "string"
					},
					"NetworkingHubId": {
						"$ref": "#\/components\/schemas\/ro-uuidv4"
					},
					"Status": {
						"description": "The status of the CIDR Range.",
						"enum": [
							"ACTIVE",
							"DELETED",
							"CREATE_FAILED",
							"DELETE_FAILED"
						],
						"example": "ACTIVE",
						"readOnly": true,
						"type": "string"
					},
					"Tags": {
						"$ref": "#\/components\/schemas\/Tags"
					}
				},
				"required": [
					"Name",
					"Cidr"
				],
				"type": "object"
			},
			"Config": {
				"properties": {
					"API": {
						"properties": {
							"endpoints": {
								"items": {
									"$ref": "#\/components\/schemas\/ConfigEndpoint"
								},
								"type": "array"
							}
						},
						"type": "object"
					},
					"Analytics": {
						"properties": {
							"disable": {
								"type": "boolean"
							}
						},
						"type": "object"
					},
					"ApiAuth": {
						"properties": {
							"identityPoolId": {
								"type": "string"
							},
							"mandatorySignIn": {
								"type": "boolean"
							},
							"region": {
								"$ref": "#\/components\/schemas\/AwsRegion"
							},
							"userPoolId": {
								"type": "string"
							},
							"userPoolWebClientId": {
								"type": "string"
							}
						},
						"type": "object"
					},
					"AppSync": {
						"properties": {
							"analytics": {
								"properties": {
									"endpoint": {
										"type": "string"
									},
									"region": {
										"$ref": "#\/components\/schemas\/AwsRegion"
									}
								},
								"type": "object"
							},
							"core": {
								"properties": {
									"endpoint": {
										"type": "string"
									},
									"region": {
										"$ref": "#\/components\/schemas\/AwsRegion"
									}
								},
								"type": "object"
							},
							"graphqlEndpoint": {
								"type": "string"
							},
							"region": {
								"$ref": "#\/components\/schemas\/AwsRegion"
							}
						},
						"type": "object"
					},
					"Auth": {
						"properties": {
							"identityPoolId": {
								"type": "string"
							},
							"mandatorySignIn": {
								"type": "boolean"
							},
							"region": {
								"$ref": "#\/components\/schemas\/AwsRegion"
							},
							"userPoolId": {
								"type": "string"
							},
							"userPoolWebClientId": {
								"type": "string"
							}
						},
						"type": "object"
					},
					"Juma": {
						"properties": {
							"controlplaneRegion": {
								"type": "string"
							},
							"domainName": {
								"type": "string"
							},
							"fullDomainName": {
								"type": "string"
							},
							"stage": {
								"type": "string"
							}
						},
						"type": "object"
					},
					"JumaAuth": {
						"properties": {
							"identityPoolId": {
								"type": "string"
							},
							"mandatorySignIn": {
								"type": "boolean"
							},
							"region": {
								"$ref": "#\/components\/schemas\/AwsRegion"
							},
							"userPoolId": {
								"type": "string"
							},
							"userPoolWebClientId": {
								"type": "string"
							}
						},
						"type": "object"
					},
					"Sentry": {
						"properties": {
							"dsn": {
								"type": "string"
							},
							"projectName": {
								"type": "string"
							}
						},
						"type": "object"
					},
					"Zone": {
						"properties": {
							"key": {
								"type": "string"
							}
						},
						"type": "object"
					}
				},
				"required": [
					"Auth",
					"API"
				],
				"type": "object"
			},
			"ConfigEndpoint": {
				"properties": {
					"endpoint": {
						"type": "string"
					},
					"name": {
						"type": "string"
					},
					"region": {
						"$ref": "#\/components\/schemas\/AwsRegion"
					}
				},
				"type": "object"
			},
			"CreateCatalogueDetail": {
				"allOf": [
					{
						"$ref": "#\/components\/schemas\/BaseEventDetail"
					}
				],
				"properties": {
					"TraceId": {
						"type": "string"
					},
					"WorkloadCatalogueItem": {
						"properties": {
							"CatalogueId": {
								"$ref": "#\/components\/schemas\/ro-uuidv4"
							},
							"Description": {
								"description": "Description of the Workload.",
								"example": "A Workload to build a VPC in my org",
								"maxLength": 1024,
								"type": "string"
							},
							"ManifestURL": {
								"description": "HTTPS\/S3 URL of the manifest. Either this or ManifestBody must be provided.",
								"example": "S3:\/\/{StaxArtifactBucket}\/workload-vpc\/your-template-ref.yml",
								"type": "string"
							},
							"Name": {
								"description": "Name of the Workload Catalogue Item to create.",
								"example": "my-directory-service",
								"maxLength": 64,
								"minLength": 2,
								"type": "string"
							},
							"Operation": {
								"$ref": "#\/components\/schemas\/Operation"
							},
							"OrganisationId": {
								"$ref": "#\/components\/schemas\/ro-uuidv4"
							},
							"Public": {
								"description": "Boolean value declaring if the Workload Catalogue Item is public or private.",
								"example": false,
								"type": "boolean"
							},
							"Tags": {
								"$ref": "#\/components\/schemas\/Tags"
							},
							"Version": {
								"example": "0.01",
								"readOnly": true,
								"type": "string"
							}
						},
						"type": "object"
					}
				},
				"type": "object"
			},
			"CreateCatalogueEvent": {
				"allOf": [
					{
						"$ref": "#\/components\/schemas\/BaseEvent"
					}
				],
				"properties": {
					"CatalogueId": {
						"$ref": "#\/components\/schemas\/ro-uuidv4"
